INSERT INTO `cms_block` VALUES ('20', 'Mini cart above products', 'block_mini_cart_above_products', '<div style=\"padding:15px; background-color:#f5f5f5; color:#d90000;\" title=\"Customizable CMS block for promo info\">\n<a class=\"go\" href=\"{{store url=\"\"}}\">Check our latest super promotions!</a>\n</div>', '2015-04-24 12:00:50', '2015-04-24 12:00:50', '0');
INSERT INTO `cms_block` VALUES ('21', 'Custom Tab 1', 'block_product_tab1', '<p>Custom CMS block displayed as a tab. You can use it to display info about returns and refunds, latest promotions etc. You can put your own content here: text, HTML, images - whatever you like. There are <strong>many similar blocks</strong> accross the store. All CMS blocks are editable from the admin panel.</p>\n\n<div class=\"feature indent first\">\n	<span class=\"icon i-right no-bg-color\"></span>\n	<p class=\"no-margin\"><strong>Magento Community Edition is the most powerful</strong> open source e-commerce software and can be downloaded 100% for free. Developers can modify the core code, add custom features and functionality by installing extensions from Magento Connect marketplace.</p>\n</div>\n<div class=\"feature indent\">\n	<span class=\"icon i-right no-bg-color\"></span>\n	<p class=\"no-margin\"><strong>Manage the fully dynamic catalog</strong> with the intutive admistrative interface. The flexible catalog system includes various options for the display of items. Magento is also integrated with a variety of major payment gateways out of the box.</p>\n</div>\n<div class=\"feature indent last\">\n	<span class=\"icon i-right no-bg-color\"></span>\n	<p class=\"no-margin\"><strong>Magento is a fully global platform</strong>, allowing for the expansion of business or simply offering multiple versions of your site to meet the needs of your customers.\nTranslated into over 60 languages, supporting multiple currencies, payment methods and taxes, Magento allows for internationalization of your online stores.</p>\n</div>', '2015-04-24 12:00:50', '2015-04-24 12:00:50', '1');
INSERT INTO `cms_block` VALUES ('22', 'Custom Tab 2', 'block_product_tab2', '<p>Another custom CMS block displayed as a tab. You can use it to display info about returns and refunds, latest promotions etc. You can put your own content here: text, HTML, images - whatever you like. There are <strong>many similar blocks</strong> accross the store. All CMS blocks are editable from the admin panel.</p>\n\n<p>Lorem ipsum dolor sit, consectetur adipiscing elit. Etiam neque velit, blandit sed scelerisque quis. Nullam ornare enim nec justo bibendum lobortis. In eget metus.</p>', '2015-04-24 12:00:50', '2015-04-24 12:00:50', '0');
