INSERT INTO `cms_block` VALUES ('28', 'Footer column 5', 'block_footer_column5', '<div class=\"grid12-3\">\n	<div class=\"collapsible mobile-collapsible\">\n\n		<h6 class=\"block-title heading\">About Ultimo</h6>\n		<div class=\"block-content\">\n			<img src=\"{{media url=\"wysiwyg/infortis/ultimo/custom/logo-small.png\"}}\" alt=\"Ultimo Theme\" style=\"padding-bottom:10px;\" />\n			<div class=\"feature first last\">\n				<p>Ultimo is a premium Magento theme with advanced admin module. It’s extremely customizable, easy to use and fully responsive.</p>\n				<h5><a class=\"go\" href=\"http://themeforest.net/item/ultimo-fluid-responsive-magento-theme/3231798?ref=infortis\">Buy this theme</a></h5>\n			</div>\n		</div>\n\n	</div>\n</div>\n\n<div class=\"grid12-3\">\n	<div class=\"collapsible mobile-collapsible\">\n\n		<h6 class=\"block-title heading\">Theme Features</h6>\n		<div class=\"block-content\">\n			<ul class=\"bullet\">\n				<li><a href=\"{{store url=\'ultimo-responsive-magento-theme\'}}\">Theme Features</a></li>\n				<li><a href=\"{{store url=\'typography\'}}\">Typography</a></li>\n				<li><a href=\"#\">Some Sample Link</a></li>\n				<li><a href=\"#\">Meat Our Best Partners</a></li>\n				<li><a href=\"#\">Latest Work Samples</a></li>\n				<li><a href=\"#\">Our Other Projects</a></li>\n				<li><a href=\"#\">One Click To Join Us</a></li>\n				<li><a href=\"#\">Follow Us On Twitter</a></li>\n				<li><a href=\"http://infortis-themes.com/\">Magento Themes</a></li>\n				<li><a href=\"#\">Ecommerce</a></li>\n			</ul>\n		</div>\n\n	</div>\n</div>\n\n<div class=\"grid12-3\">\n	<div class=\"collapsible mobile-collapsible\">\n\n		<h6 class=\"block-title heading\">Key Features</h6>\n		<div class=\"block-content\">\n			<div class=\"feature feature-icon-hover indent first\">\n				<span class=\"ib ic ic-char\">1</span>\n				<p class=\"no-margin\">Unlimited colors, hundreds of customizable elements</p>\n			</div>\n			<div class=\"feature feature-icon-hover indent\">\n				<span class=\"ib ic ic-char\">2</span>\n				<p class=\"no-margin \">Customizable responsive layout based on fluid grid</p>\n			</div>\n			<div class=\"feature feature-icon-hover indent\">\n				<span class=\"ib ic ic-char\">3</span>\n				<p class=\"no-margin \">50+ placeholders to display custom content</p>\n			</div>\n			<div class=\"feature feature-icon-hover indent\">\n				<span class=\"ib ic ic-char\">4</span>\n				<p class=\"no-margin \">Create your custom sub-themes (variants)</p>\n			</div>\n		</div>\n\n	</div>\n</div>\n\n<div class=\"grid12-3\">\n	<div class=\"collapsible mobile-collapsible\">\n\n		<h6 class=\"block-title heading\">Company Info</h6>\n		<div class=\"block-content\">\n			<div class=\"feature feature-icon-hover indent first\">\n				<span class=\"ib ic ic-phone ic-lg\"></span>\n				<p class=\"no-margin \">Call Us +001 555 801<br/>Fax +001 555 802</p>\n			</div>\n			<div class=\"feature feature-icon-hover indent\">\n				<span class=\"ib ic ic-mobile ic-lg\"></span>\n				<p class=\"no-margin \">+77 123 1234<br/>+42 98 9876</p>\n			</div>\n			<div class=\"feature feature-icon-hover indent\">\n				<span class=\"ib ic ic-letter ic-lg\"></span>\n				<p class=\"no-margin \">boss@example.com<br/>me@example.com</p>\n			</div>\n			<div class=\"feature feature-icon-hover indent last\">\n				<span class=\"ib ic ic-skype ic-lg\"></span>\n				<p class=\"no-margin \">Skype: samplelogin<br/>skype-support</p>\n			</div>\n		</div>\n\n	</div>\n</div>', '2015-04-24 12:00:50', '2015-04-24 12:00:50', '0');
INSERT INTO `cms_block` VALUES ('29', 'Footer column 6', 'block_footer_column6', '<h6 class=\"heading\">Sample Column</h6>\n<ul>\n	<li><a href=\"#\">Responsive Magento Theme</a></li>\n	<li><a href=\"#\">Magento Extensions</a></li>\n	<li><a href=\"#\">Store Overview</a></li>\n	<li><a href=\"#\">Buy This</a></li>\n	<li><a href=\"#\">Sample Link</a></li>\n	<li><a href=\"#\">Some Other Link</a></li>\n	<li><a href=\"#\">Link Example</a></li>\n</ul>', '2015-04-24 12:00:50', '2015-04-24 12:00:50', '0');
INSERT INTO `cms_block` VALUES ('30', 'Über DMC', 'block_header_nav_dropdown', '<div class=\"grid-container-spaced\">\r\n<div class=\"grid12-3\"><a href=\"{{store url=\'ultimo-responsive-magento-theme\'}}\"> <img class=\"fade-on-hover\" alt=\"Magento CMS blocks\" src=\"{{media url=\'wysiwyg/infortis/ultimo/menu/custom/01.png\'}}\" /> </a>\r\n<h4 class=\"heading\">50+ CMS blocks</h4>\r\n<p>You can use CMS blocks as content placeholders to display custom content in almost every part of the store. Import sample CMS blocks from the demo.</p>\r\n</div>\r\n<div class=\"grid12-3\"><a href=\"{{store url=\'ultimo-responsive-magento-theme\'}}\"> <img class=\"fade-on-hover\" alt=\"Magento CMS blocks\" src=\"{{media url=\'wysiwyg/infortis/ultimo/menu/custom/01.png\'}}\" /> </a>\r\n<h4 class=\"heading\">50+ CMS blocks</h4>\r\n<p>You can use CMS blocks as content placeholders to display custom content in almost every part of the store. Import sample CMS blocks from the demo.</p>\r\n</div>\r\n<div class=\"grid12-3\"><a href=\"{{store url=\'ultimo-responsive-magento-theme\'}}\"> <img class=\"fade-on-hover\" alt=\"Magento theme documentation\" src=\"{{media url=\'wysiwyg/infortis/ultimo/menu/custom/02.png\'}}\" /> </a>\r\n<h4 class=\"heading\">190-pages documentation</h4>\r\n<p>The best Magento theme documentation on ThemeForest. It also describes selected Magento features which you need to know when starting to work with Magento.</p>\r\n</div>\r\n<div class=\"grid12-3\"><a href=\"{{store url=\'ultimo-responsive-magento-theme\'}}\"> <img class=\"fade-on-hover\" alt=\"Create Magento sub-themes\" src=\"{{media url=\'wysiwyg/infortis/ultimo/menu/custom/03.png\'}}\" /> </a>\r\n<h4 class=\"heading\">Easy to customize</h4>\r\n<p>Use Ultimo as a starting point for your custom projects. Unlike many other themes, Ultimo lets you create multiple custom sub-themes (theme variants) for your clients.</p>\r\n</div>\r\n</div>', '2015-04-24 12:00:50', '2015-04-27 11:48:07', '1');
