content here: text, HTML, images - whatever you want. You can create landing page for every category.</p>\n	</div>\n	<br />\n\n</div>', '2015-04-24 12:00:52', '2015-04-24 12:00:52', '1');
INSERT INTO `cms_block` VALUES ('55', 'Slideshow banners', 'block_slideshow_banners', '<a class=\"banner fade-on-hover\" href=\"{{store url=\'about-magento-demo-store\'}}\">\n	<img src=\"{{media url=\'wysiwyg/infortis/ultimo/slideshow/banner/01.png\'}}\" alt=\"Sample banner\" />\n\n	<div class=\"caption light1 full-width right\">\n		<p class=\"right\">Sample caption</p>\n	</div>\n\n</a>\n\n<a class=\"banner fade-on-hover\" href=\"{{store url=\'about-magento-demo-store\'}}\">\n	<img src=\"{{media url=\'wysiwyg/infortis/ultimo/slideshow/banner/02.png\'}}\" alt=\"Sample banner\" />\n\n	<div class=\"caption dark1 full-width right\">\n		<p class=\"right\">Add custom text</p>\n	</div>\n\n</a>\n\n<a class=\"banner fade-on-hover\" href=\"{{store url=\'about-magento-demo-store\'}}\">\n	<img src=\"{{media url=\'wysiwyg/infortis/ultimo/slideshow/banner/03.png\'}}\" alt=\"Sample banner\" />\n\n	<div class=\"caption dark3 full-width right\">\n		<p class=\"right\">Caption sample</p>\n	</div>\n</a>', '2015-04-24 12:00:52', '2015-04-24 12:00:52', '1');
INSERT INTO `cms_block` VALUES ('56', 'Home page - preface', 'block_home_preface', '<br/>\n<br/>\n<div class=\"grid12-3\">\n\n	<div class=\"feature feature-icon-hover indent indent-size-xl\">\n		<span class=\"ic ic-2x ic-paint ib ib-size-xl\"></span>\n		<h6 class=\"above-heading\">Customizable design</h6>\n		<h3>Unlimited Colors</h3>\n		<p>You have never seen so many options! Change colors of dozens of elements, apply textures, upload background images...</p>\n		<a href=\"{{store url=\'ultimo-responsive-magento-theme\'}}\" class=\"go\">See all features</a>\n	</div>\n\n</div>\n<div class=\"grid12-3\">\n\n	<div class=\"feature feature-icon-hover indent indent-size-xl\">\n		<span class=\"ic ic-2x ic-smartphones ib ib-size-xl\"></span>\n		<h6 class=\"above-heading\">12-column grid</h6>\n		<h3>Responsive Layout</h3>\n		<p>Ultimo can be displayed on any screen. It is based on fluid grid system. If screen is resized, layout will be automatically adjusted...</p>\n		<a href=\"{{store url=\'ultimo-responsive-magento-theme\'}}\" class=\"go\">See all features</a>\n	</div>\n\n</div>\n<div class=\"grid12-3\">\n\n	<div class=\"feature feature-icon-hover indent indent-size-xl\">\n		<span class=\"ic ic-2x ic-menu ib ib-size-xl\"></span>\n		<h6 class=\"above-heading\">Customizable drop-down menu</h6>\n		<h3>Mega Menu</h3>\n		<p>Two styles: wide mega menu or classic drop-down menu. You can add any custom content (images, text, HTML) to any category in the catalog...</p>\n		<a href=\"{{store url=\'ultimo-responsive-magento-theme\'}}\" class=\"go\">See all features</a>\n	</div>\n\n</div>\n<div class=\"grid12-3\">\n\n	<div class=\"feature feature-icon-hover  indent indent-size-xl\">\n		<span class=\"ic ic-2x ic-star ib ib-size-xl\"></span>\n		<h6 class=\"above-heading\">Content placeholders</h6>\n		<h3>50+ CMS blocks</h3>\n		<p>You can use content placeholders to display custom content in almost every part of the store. Import sample CMS blocks from the demo...</p>\n		<a href=\"{{store url=\'ultimo-responsive-magento-theme\'}}\" class=\"go\">See all features</a>\n	</div>\n\n</div>\n<div class=\"clearer\"></div>\n<br/>\n<br/>\n<br/>', '2015-04-24 12:00:52', '2015-04-24 12:00:52', '0');
