INSERT INTO `cms_page` VALUES ('1', 'Seite nicht gefunden', 'one_column', 'Page keywords', 'Page description', 'no-route', 'Seite nicht gefunden', '\n\n\n<h2>404 - Seite nicht gefunden</h2>\n<p>Leider konnte die angeforderte Seite nicht gefunden werden, scheinbar wurde eine nicht korrekte URL eingegeben. So ist der 404 Fehler entstanden. Bitte nutzen Sie unsere <a href=\"{{store url=\"catalogsearch/advanced\"}}\">Suche</a> oder wechseln Sie zu unserer <a href=\"{{store url=\"\"}}\">Startseite</a> um in unserem umfangreichen Sortiment zu stöbern.</p>\n<ul>\n    <li><a href=\"{{store url=\'catalogsearch/advanced\'}}\">Suche</a></li>\n    <li><a href=\"{{store url=\'\'}}\">Startseite</a></li>\n</ul>\n', '2015-04-24 10:59:26', '2015-04-24 11:12:22', '1', '0', null, null, null, null, null, null);
INSERT INTO `cms_page` VALUES ('2', 'Home page', 'two_columns_left', null, null, 'home', null, '<div class=\"page-title\"><h2>Home Page</h2></div>', '2015-04-24 10:59:26', '2015-05-26 07:46:56', '1', '0', '<!--<reference name=\"content\">\r\n        <block type=\"catalog/product_new\" name=\"home.catalog.product.new\" alias=\"product_new\" template=\"catalog/product/new.phtml\" after=\"cms_page\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_viewed\" name=\"home.reports.product.viewed\" alias=\"product_viewed\" template=\"reports/home_product_viewed.phtml\" after=\"product_new\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_compared\" name=\"home.reports.product.compared\" template=\"reports/home_product_compared.phtml\" after=\"product_viewed\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name=\"right\">\r\n        <action method=\"unsetChild\"><alias>right.reports.product.viewed</alias></action>\r\n        <action method=\"unsetChild\"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->', null, null, null, null, null);
