     <td style=\"font:9px/1em Verdana, Arial, Helvetica, sans-serif;\">\n                                {{block type=\"cms/block\" block_id=\"revocation\"}}\n                            </td>\n                        </tr>\n                        \n                    \n                        \n                        <tr><td style=\"border-bottom:2px solid #eee;\">&nbsp;</td></tr>\n                        <tr>\n                            <td style=\"font:9px/1em Verdana, Arial, Helvetica, sans-serif;\">\n                                {{block type=\"cms/block\" block_id=\"revocation_form\"}}\n                            </td>\n                        </tr>\n                        \n                    </table>\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer\"}}\r\n', null, '2', '{{var store.getFrontendName()}}: Neue Bestellung Nr. {{var order.increment_id}}', null, null, '2015-04-24 11:12:23', '2015-04-24 11:12:23', null, null);
INSERT INTO `core_email_template` VALUES ('12', 'Bestellung Aktualsierung (de_DE)', '\r\n\r\n\r\n\r\n{{template config_path=\"design/email/header\"}}\r\n{{inlinecss file=\"email-inline.css\"}}\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n    <tr>\r\n        <td>\r\n            <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n                <tr>\r\n                    <td class=\"action-content\">\r\n                        <h1>Hallo {{htmlescape var=$order.getCustomerName()}},</h1>\r\n                        <p>Ihre Bestellung Nr. <span class=\"no-link\">#{{var order.increment_id}}</span> hat den Status <strong>{{var order.getStatusLabel()}}</strong>.</p>\r\n                        {{if comment}}\r\n                        <table cellspacing=\"0\" cellpadding=\"0\" class=\"message-container\">\r\n                            <tr>\r\n                                <td>{{var comment}}</td>\r\n                            </tr>\r\n                        </table>\r\n                        {{/if}}\r\n                        <p>Sie können den Status Ihrer Bestellung jederzeit in <a href=\"{{store url=\"customer/account/\"}}\">Ihrem Benutzerkonto</a> einsehen.</p>\r\n                        {{template config_path=\"design/email/support\"}}\r\n                    </td>\r\n                </tr>\r\n            \n                        \n                        <tr>\n                            <td>\n                                {{block type=\"magesetup/imprint_content\" template=\"magesetup/imprint/email_footer.phtml\"}}\n                            </td>\n                        </tr>\n                        \n                    </table>\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer\"}}\r\n', null, '2', '{{var store.getFrontendName()}}: Informationen zu Bestellung Nr. {{var order.increment_id}}', null, null, '2015-04-24 11:12:23', '2015-04-24 11:12:23', null, null);
