\">\r\n        <td>\r\n            {{if comment}}\r\n            <table cellspacing=\"0\" cellpadding=\"0\" class=\"message-container\">\r\n                <tr>\r\n                    <td>{{var comment}}</td>\r\n                </tr>\r\n            </table>\r\n            {{/if}}\r\n            {{layout area=\"frontend\" handle=\"sales_email_order_invoice_items\" invoice=$invoice order=$order}}\r\n            <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n                <tr>\r\n                    <td class=\"address-details\">\r\n                        <h6>Rechnungsadresse:</h6>\r\n                        <p><span class=\"no-link\">{{var order.billing_address.format(\'html\')}}</span></p>\r\n                    </td>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <td class=\"address-details\">\r\n                        <h6>Lieferadresse:</h6>\r\n                        <p><span class=\"no-link\">{{var order.shipping_address.format(\'html\')}}</span></p>\r\n                    </td>\r\n                    {{/depend}}\r\n                </tr>\r\n                <tr>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <td class=\"method-info\">\r\n                        <h6>Versandart:</h6>\r\n                        <p>{{var order.shipping_description}}</p>\r\n                    </td>\r\n                    {{/depend}}\r\n                    <td class=\"method-info\">\r\n                        <h6>Zahlungsart:</h6>\r\n                        {{var payment_html}}\r\n                    </td>\r\n                </tr>\r\n            \n                        \n                        <tr>\n                            <td>\n                                {{block type=\"magesetup/imprint_content\" template=\"magesetup/imprint/email_footer.phtml\"}}\n                            </td>\n                        </tr>\n                        \n                    </table>\r\n        </td>\r\n  