INSERT INTO `core_email_template` VALUES ('24', 'Lieferung Aktualisierung (de_DE)', '\r\n\r\n\r\n\r\n{{template config_path=\"design/email/header\"}}\r\n{{inlinecss file=\"email-inline.css\"}}\r\n\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n    <tr>\r\n        <td>\r\n            <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n                <tr>\r\n                    <td class=\"action-content\">\r\n                        <h1>Hallo {{htmlescape var=$order.getCustomerName()}},</h1>\r\n                        <p>Ihre Bestellung Nr. <span class=\"no-link\">#{{var order.increment_id}}</span> hat den Status <strong>{{var order.getStatusLabel()}}</strong>.</p>\r\n                        {{if comment}}\r\n                        <table cellspacing=\"0\" cellpadding=\"0\" class=\"message-container\">\r\n                            <tr>\r\n                                <td>{{var comment}}</td>\r\n                            </tr>\r\n                        </table>\r\n                        {{/if}}\r\n                        <p>Sie können den aktuellen Status Ihrer Bestellung jederzeit in <a href=\"{{store url=\"customer/account/\"}}\">Ihrem Benutzerkonto</a> einsehen.</p>\r\n                        {{template config_path=\"design/email/support\"}}\r\n                    </td>\r\n                </tr>\r\n            \n                        \n                        <tr>\n                            <td>\n                                {{block type=\"magesetup/imprint_content\" template=\"magesetup/imprint/email_footer.phtml\"}}\n                            </td>\n                        </tr>\n                        \n                    </table>\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer\"}}\r\n', null, '2', '{{var store.getFrontendName()}}: Informationen zu Versand Nr. {{var shipment.increment_id}}', null, null, '2015-04-24 11:12:23', '2015-04-24 11:12:23', null, null);
INSERT INTO `core_email_template` VALUES ('25', 'Lieferung Aktualisierung Gast (de_DE)', '\r\n\r\n\r\n\r\n{{template config_path=\"design/email/header\"}}\r\n{{inlinecss file=\"email-inline.css\"}}\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n    <tr>\r\n        <td>\r\n            <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n                <tr>\r\n                    <td class=\"action-content\">\r\n                        <h1>Hallo {{htmlescape var=$order.getCustomerName()}},</h1>\r\n                        <p>Ihre Bestellung Nr. <span class=\"no-link\">#{{var order.increment_id}}</span> hat den Status <strong>{{var order.getStatusLabel()}}</strong>.</p>\r\n                        {{if comment}}\r\n                        <table cellspacing=\"0\" cellpadding=\"0\" class=\"message-container\">\r\n                            <tr>\r\n                                <td>{{var comment}}</td>\r\n                            </tr>\r\n                        </table>\r\n                        {{/if}}\r\n                        {{template config_path=\"design/email/support\"}}\r\n                    </td>\r\n                </tr>\r\n            \n                        \n                        <tr>\n                            <td>\n                                {{block type=\"magesetup/imprint_content\" template=\"magesetup/imprint/email_footer.phtml\"}}\n                            </td>\n                        </tr>\n                        \n                    </table>\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer\"}}\r\n', null, '2', '{{var store.getFrontendName()}}: Informationen zu Versand Nr. {{var shipment.increment_id}}', null, null, '2015-04-24 11:12:23', '2015-04-24 11:12:23', null, null);
INSERT INTO `core_email_template` VALUES ('26', 'Zahlung fehlgeschlagen (de_DE)', '\n\n\n<table>\n    <thead>\n    <tr>\n        <th>Zahlung fehlgeschlagen.</th>\n    </tr>\n    </thead>\n    <tbody>\n    <tr>\n        <td>\n            <p>\n                <b>Grund</b><br />\n                {{var reason}}\n            </p>\n            <p>\n                <b>Bezahlvorgang</b><br />\n                {{var checkoutType}}\n            </p>\n            <p>\n                <b>Kunde</b><br />\n                <a href=\"mailto:{{var customerEmail}}\">{{var customer}}</a> &lt;{{var customerEmail}}&gt;\n            </p>\n            <p>\n                <b>Artikel</b><br />\n                {{var items}}\n            </p>\n            <p>\n                <b>Gesamtsumme</b><br />\n                {{var total}}\n            </p>\n            <p>\n                <b>Rechnungsadresse</b><br />\n                {{var billingAddress.format(\'html\')}}\n            </p>\n            <p>\n                <b>Versandadresse</b><br />\n                {{var shippingAddress.format(\'html\')}}\n            </p>\n            <p>\n                <b>Versandart</b><br />\n                {{var shippingMethod}}\n            </p>\n            <p>\n                <b>Zahlungsart</b><br />\n                {{var paymentMethod}}\n            </p>\n            <p>\n                <b>Datum &amp; Zeit</b><br />\n                {{var dateAndTime}}\n            </p>\n        </td>\n    </tr>\n    </tbody>\n</table>', null, '2', 'Zahlung fehlgeschlagen', null, null, '2015-04-24 11:12:23', '2015-04-24 11:12:23', null, null);
INSERT INTO `core_email_template` VALUES ('27', 'Protokoll Bereinigung Warnungen (de_DE)', '\n\nWarnungen bei der Bereinigung des Logs:\n\n{{var warnings}}', null, '1', 'Warunungen der Log-Bereinigung', null, null, '2015-04-24 11:12:23', '2015-04-24 11:12:23', null, null);
INSERT INTO `core_email_template` VALUES ('28', 'Newsletter Anmeldung Bestätigung (de_DE)', '\r\n\r\n\r\n\r\n{{template config_path=\"design/email/header\"}}\r\n{{inlinecss file=\"email-inline.css\"}}\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n    <tr>\r\n        <td class=\"action-content\">\r\n            <h1>Vielen Dank für Ihre Newsletter-Anmeldung.</h1>\r\n            <p>Bitte klicken Sie auf den unterstehenden Link, um Ihre Anmeldung zu bestätigen:</p>\r\n            <table cellspacing=\"0\" cellpadding=\"0\" class=\"action-button\" >\r\n                <tr>\r\n                    <td>\r\n                        <a href=\"{{var subscriber.getConfirmationLink()}}\"><span>Newsletter-Anmeldung bestätigen</span></a>\r\n                    </td>\r\n                </tr>\r\n            \n                        \n                        <tr>\n                            <td>\n                                {{block type=\"magesetup/imprint_content\" template=\"magesetup/imprint/email_footer.phtml\"}}\n                            </td>\n                        </tr>\n                        \n                    </table>\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer\"}}\r\n', null, '2', 'Bitte bestätigen Sie Ihre Newsletter-Anmeldung!', null, null, '2015-04-24 11:12:23', '2015-04-24 11:12:23', null, null);
INSERT INTO `core_email_template` VALUES ('29', 'Newsletter Anmeldung Erfolg (de_DE)', '\n\n{{template config_path=\"design/email/header\"}}\n{{inlinecss file=\"email-inline.css\"}}\n\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\n    <tr>\n        <td class=\"action-content\">\n            <h4>Wir haben Sie erfolgreich für unseren Newsletter angemeldet.</h4>\n        </td>\n    </tr>\n</table>\n\n{{template config_path=\"design/email/footer\"}}\n', null, '2', 'Newsletter Anmeldung erfolgreich', null, null, '2015-04-24 11:12:23', '2015-04-24 11:12:23', null, null);
INSERT INTO `core_email_template` VALUES ('30', 'Newsletter Abmeldung Erfolg (de_DE)', '\n\n{{template config_path=\"design/email/header\"}}\n{{inlinecss file=\"email-inline.css\"}}\n\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\n    <tr>\n        <td class=\"action-content\">\n            <h1>Wir haben Sie erfolgreich von unserem Newsletter abgemeldet.</h1>\n        </td>\n    </tr>\n</table>\n\n{{template config_path=\"design/email/footer\"}}', null, '2', 'Newsletter Abmeldung erfolgreich', null, null, '2015-04-24 11:12:23', '2015-04-24 11:12:23', null, null);
INSERT INTO `core_email_template` VALUES ('31', 'Wunschliste gemeinsam nutzen (de_DE)', '\n\n\n\n{{template config_path=\"design/email/header\"}}\n{{inlinecss file=\"email-inline.css\"}}\n\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\n    <tr>\n        <td>\n            <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\n                <tr>\n                    <td class=\"action-content\">\n                        <h1>Hallo,<br/>hier gibt es meinen Wunschzettel von {{var store.getFrontendName()}}.</h1>\n                        <table cellspacing=\"0\" cellpadding=\"0\" class=\"message-container\">\n                            <tr>\n                                <td>{{var message}}</td>\n                            </tr>\n                        </table>\n                        {{var items}}\n                        {{depend salable}}\n                        <p><strong><a href=\"{{var addAllLink}}\">Alle Artikel in den Warenkorb legen</a></strong> |\n                        {{/depend}}\n                        <strong><a href=\"{{var viewOnSiteLink}}\">Alle Artikel ansehen</a></strong></p>\n                    </td>\n                </tr>\n            </table>\n        </td>\n    </tr>\n</table>\n\n{{template config_path=\"design/email/footer\"}}\n', null, '2', 'Wunschzettel von {{var customer.name}} bei {{var store.getFrontendName()}}', null, null, '2015-04-24 11:12:23', '2015-04-24 11:12:23', null, null);
INSERT INTO `core_email_template` VALUES ('32', 'Produkt an einen Freund verschicken (de_DE)', '\n\n\n{{template config_path=\"design/email/header\"}}\n{{inlinecss file=\"email-inline.css\"}}\n\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\n    <tr>\n        <td class=\"action-content\">\n            <h1>Hallo {{htmlescape var=$name}},</h1>\n            <p>{{htmlescape var=$sender_name}} möchte Ihnen folgendes Produkt zeigen: <a href=\"{{var product_url}}\">{{var product_name}}</a></p>\n            <table cellspacing=\"0\" cellpadding=\"0\" class=\"message-container\">\n                <tr>\n                    <td><strong>Nachricht:</strong> {{var message}}</td>\n                </tr>\n            \n                        \n                        <tr>\n                            <td>\n                                {{block type=\"magesetup/imprint_content\" template=\"magesetup/imprint/email_footer.phtml\"}}\n                            </td>\n                        </tr>\n                        \n                    </table>\n        </td>\n    </tr>\n</table>\n\n{{template config_path=\"design/email/footer\"}}', null, '2', 'Willkommen {{var name}}', null, null, '2015-04-24 11:12:23', '2015-04-24 11:12:23', null, null);
